import React, { Component } from "react";
import {
  ListGroup,
  ListGroupItem,
  Badge,
  Jumbotron,
  Container,
} from "reactstrap";
import pic from "../assets/img/haland.jpeg";
class BestPlayers extends Component {
  render() {
    return (
      <>
        <div>
          <Jumbotron>
            <Container style={{ height: 0, marginTop: -30 }}>
              <h1 className="display-5 text-center bgcolor-orange">
                Best Players
              </h1>
            </Container>
          </Jumbotron>
        </div>
        <ListGroup>
          <ListGroupItem
            style={{ marginLeft: 120, marginRight: 120, borderRadius: 30 }}
            color="primary"
          >
            <h1>
              <Badge
                style={{
                  height: 50,
                  width: 50,
                  borderRadius: 25,
                  marginRight: 30,
                  paddingTop: 15,
                }}
                color="warning"
              >
                1
              </Badge>
              Cras justo odio
            </h1>
          </ListGroupItem>
          <ListGroupItem>
            <img style={{ width: 60, height: 60 }} alt="..." src={pic} />
          </ListGroupItem>
          <ListGroupItem color="info">Dapibus ac facilisis in</ListGroupItem>
          <ListGroupItem color="warning">Morbi leo risus</ListGroupItem>
          <ListGroupItem color="danger">Porta ac consectetur ac</ListGroupItem>
        </ListGroup>
      </>
    );
  }
}
export default BestPlayers;
